import React from 'react';

const Card = () => {
    return (
        <div className="bg-light-blue dib br3 pa3 ma2 grow bw2 shadow-5 tc">
            <img src="http://cyborg.namedecoder.com/webimages/edox-MISI.png" alt="MISI robot" height="200px" width="200px"/>
            <h2>Machine Intended <br></br>for Sabotage and <br></br>Infiltration</h2>
            <p>kaloczy.mihaly@gmail.com</p>
        </div>
    );
}

export default Card;
